import './App.css';
const fruits = ["apple", "orange", "banana", "pear", "laichi", "strawberry"];
const [a,b,c, ...other] = fruits;
// equivalent to
// const a = fruits[0];
// const b = fruits[1];
// const c = fruits[2];

function restComponent() {
  return <div>{other}</div>;
}
function App() {
  return (
    <>
    <p>432432</p>
    <h1>Who lives in my garage?</h1>
    <Car brand="Ford" />

  </>
  );
}

function Car(props) {
  return <h2>I am a { props.brand }!</h2>;
}

function Garage() {
  return (
    <>
      <p>432432</p>
      <h1>Who lives in my garage?</h1>
      <Car brand="Ford" />
    </>
  );
}

export default App;
